    overview:
      "<p>Asthma is a chronic lung disease that causes repeated episodes of chest tightness, wheezing, cough, and shortness of breath. It can be life threatening. Asthma affects people of all ages, but has a particular impact on children as one of the major chronic disease and causes of lost school time for children.</p>",
    aboutData: `<table> <tbody> <tr> <td>Data Facts</td> <td>Asthma</td> </tr> <tr> <td>Why these data are important</td> <td> Asthma is a chronic disease of the lungs in which the airways become narrow and fill with secretions, causing difficulty breathing. People with asthma have episodes of shortness of breath, chest tightness, wheezing, and/or cough, which can be serious or even fatal if not treated. Asthma attacks can be treated effectively, and asthma attacks can be prevented by a combination of medication and avoidance of triggers. </td> </tr> <tr> <td>Data Sources</td> <td> <a target="_blank" rel="noopener noreferrer" href="https://hscrc.maryland.gov/Pages/default.aspx" > Maryland Health Services Cost Review Commission </a> <br /> <a target="_blank" rel="noopener noreferrer" href="https://health.maryland.gov/phpa/OEHFP/EH/Pages/CHIPEnvCaseMgmt.aspx" >Home Visiting Services for Children with Asthma</a> </td> </tr> <tr> <td>Years available</td> <td>2010-most recent data available (usually 1-2 years prior to current date)</td> </tr> <tr> <td>Data source description</td> <td> Hospital billing data from inpatient discharges and emergency department encounters </td> </tr> <tr> <td>What's reported</td> <td> Inpatient (IP) hospitalizations; emergency department (ED) visits </td> </tr> <tr> <td>How it's reported</td> <td>Counts; crude and age-adjusted rates</td> </tr> <tr> <td>Level of geographic detail</td> <td>State, county, and census tract</td> </tr> <tr> <td>Level of demographic detail</td> <td>Race/ethnicity, sex, and age group</td> </tr> <tr> <td>Data disclaimers</td> <td> <p> HSCRC revised the methodology for coding race/ethnicity in 2013; therefore, race/ethnicity data from 2014 and later may not be comparable to previous years. </p> ICD-9 hospital billing codes transitioned to ICD-10 billing codes in 2015; therefore, data from 2016 and later may not be comparable to previous years. </td> </tr> <tr> <td> The summary data provided on this website are downloadable. For more detailed data, refer to the data sources. </td> <td>Yes</td> </tr> <tr> <td>Environmental Health Helpline</td> <td> <a href="tel:+1(866)703-3266">1-866-703-3266</a> <br /> <a href="mailto:mdh.envhealth@maryland.gov"> mdh.envhealth@maryland.gov </a> </td> </tr> <tr> <td>Last Updated</td> <td>10/8/2024</td> </tr> <tr> <td>Frequency of data updates</td> <td>Annual</td> </tr> <tr> <td>Data suppression rules</td> <td> <b>HSCRC:</b> <p>County level: suppression is for non-zero numerators <11 and this is reflected in data starting with 2021. Prior to 2021, suppression was for non-zero numerators <6. There is no denominator requirement.  </p> <p>Census tract level:  suppression is for non-zero numerators <11 OR total population <5,000.</p></td> </tr> </tbody> </table>`,
