    aboutData: `<table> <tbody> <tr> <td>Data Facts</td> <td>Drinking Water</td> </tr> <tr> <td>Why these data are important</td> <td>In Maryland, approximately five million people receive drinking water daily from more than 3,400 public water systems. Drinking water is an essential resource, and information about Maryland public water systems and contaminant levels may be used to determine the potential for public exposures from contaminants.</td> </tr> <tr> <td>Data Sources</td> <td><a target="_blank" rel="noopener noreferrer" href="https://mde.maryland.gov/programs/water/water_supply/pages/index.aspx">Maryland Department of the Environment Water Supply Program</a></td> </tr> <tr> <td>Years available</td> <td>2010-most recent data available (usually 1-2 years prior to current date)</td> </tr> <tr> <td>Data source description</td> <td>Water sampling contaminant and Community Water Systems (CWS) data</td> </tr> <tr> <td>What's reported</td> <td>Number of people receiving water from a Public Water System (PWS); PWS locations; mean concentrations of contaminants</td> </tr> <tr> <td>How it's reported</td> <td>Counts; point locations; concentrations (μg/L)</td> </tr> <tr> <td>Level of geographic detail</td> <td>State, county and point location</td> </tr> <tr> <td>Level of demographic detail</td> <td>N/A</td> </tr> <tr> <td>Data disclaimers</td> <td> <p>The number of people served by the Public Water System (PWS) is assigned to the county that the water system is based in, not the county of residence.</p> Contaminant concentrations of arsenic, nitrates, total trihalomethanes (TTHM), and haloacetic acids (HAA5) have been rounded to 1 decimal place. </td> </tr> <tr> <td>The summary data provided on this website are downloadable. For more detailed data, refer to the data sources.</td> <td>Yes</td> </tr> <tr> <td>Environmental Health Helpline</td> <td><a href="tel:+1(866)703-3266">1-866-703-3266</a><br /><a href="mailto:mdh.envhealth@maryland.gov">mdh.envhealth@maryland.gov</a></td> </tr> <tr> <td>Last Updated</td> <td>10/8/2024</td> </tr> <tr> <td>Frequency of data updates</td> <td>Annual</td> </tr> <tr> <td>Data suppression rules</td> </tr> </tbody> </table>`,
