    overview:
      "<p>Heart disease is the leading cause of death in Maryland. Heart attack (&ldquo;myocardial infarction&rdquo;) is lack of sufficient blood and oxygen to the heart muscle. Many factors contribute to the risk of having a heart attack, including environmental risk factors.</p>",
    aboutData: `<table> <tbody> <tr> <td>Data Facts</td> <td>Heart Attack</td> </tr> <tr> <td>Why these data are important</td> <td>A growing body of research has demonstrated significant associations between levels of air pollutants such as ozone, carbon monoxide, PM10, PM2.5, and sulfur dioxide, and increased risk of heart attack (also called myocardial infarction) and other forms of coronary heart disease. The air pollutant measures and heart attack indicators provided here allow for monitoring of trends over time and have the potential to identify groups with elevated risk for heart attack.</td> </tr> <tr> <td>Data Sources</td> <td><a target="_blank" rel="noopener noreferrer" href="https://hscrc.maryland.gov/Pages/default.aspx">Maryland Health Services Cost Review Commission</a><br /><a target="_blank" rel="noopener noreferrer" href="https://mde.maryland.gov/programs/air/airqualitymonitoring/pages/index.aspx">Maryland Department of the Environment Air Monitoring Program</a></td> </tr> <tr> <td>Years available</td> <td>2010-most recent data available (usually 1-2 years prior to current date)</td> </tr> <tr> <td>Data source description</td> <td>Medical record abstract of clinical, demographic, and billing data on all inpatient hospitalization discharges from Maryland's 47 hospitals</td> </tr> <tr> <td>What's reported</td> <td>Myocardial Infarction inpatient (IP) hospitalizations</td> </tr> <tr> <td>How it's reported</td> <td>Counts; crude (age-specific) and age-adjusted rates</td> </tr> <tr> <td>Level of geographic detail</td> <td>State and county</td> </tr> <tr> <td>Level of demographic detail</td> <td>Race/ethnicity, sex, and age group</td> </tr> <tr> <td>Data disclaimers</td> <td> <p>HSCRC revised the methodology for coding race/ethnicity in 2013; therefore, race/ethnicity data from 2014 and later may not be comparable to previous years.</p> ICD-9 hospital billing codes transitioned to ICD-10 billing codes in 2015; therefore, data from 2016 and later may not be comparable to previous years. </td> </tr> <tr> <td>The summary data provided on this website are downloadable. For more detailed data, refer to the data sources.</td> <td>Yes</td> </tr> <tr> <td>Environmental Health Helpline</td> <td><a href="tel:+1(866)703-3266">1-866-703-3266</a><br /><a href="mailto:mdh.envhealth@maryland.gov">mdh.envhealth@maryland.gov</a></td> </tr> <tr> <td>Last Updated</td> <td>10/8/2024</td> </tr> <tr> <td>Frequency of data updates</td> <td>Annual</td> </tr> <tr> <td> Data suppression rules </td> <td> <b> HSCRC: </b> <p> County level: suppression is for non-zero numerators <11 and this is reflected in data starting with 2021. Prior to 2021, suppression was for non-zero numerators <6. There is no denominator requirement. </p> </td> </tr> </tbody> </table>`,
