    defaultTabPath: "edTrends",
    overview:
      "<p>Chronic Obstructive Pulmonary Disease (COPD) is a group of lung diseases that causes airflow blockage and breathing problems. COPD includes two main conditions, chronic bronchitis and emphysema. COPD can be caused by genetic conditions, smoking, respiratory infection, or chronic exposure to environmental and occupational pollutants. The most significant and preventable cause of COPD is smoking.</p>",
    aboutData: `<table> <tbody> <tr> <td>Data Facts</td> <td>Chronic Obstructive Pulmonary Disorder</td> </tr> <tr> <td>Why these data are important</td> <td>Chronic Obstructive Pulmonary Disease (COPD) describes a group of diseases that restrict air flow and cause trouble breathing, including emphysema and chronic bronchitis. COPD is a leading cause of death in the US. Tobacco is a major cause of COPD. Exposure to air pollutants is also associated with COPD-related emergency department visits and hospitalizations.</td> </tr> <tr> <td>Data Sources</td> <td><a target="_blank" rel="noopener noreferrer" href="https://hscrc.maryland.gov/Pages/default.aspx">Maryland Health Services Cost Review Commission</a><br /><a target="_blank" rel="noopener noreferrer" href="https://health.maryland.gov/phpa/ccdpc/reports/pages/brfss.aspx">Maryland Behavioral Risk Factor Surveillance System</a></td> </tr> <tr> <td>Years available</td> <td>2010-most recent data available (usually 1-2 years prior to current date)</td> </tr> <tr> <td>Data source description</td> <td>Hospital billing data from inpatient discharges and emergency department encounters.<br />Standardized population-level estimates of health risk behaviors reported by non-instutionalized adults.</td> </tr> <tr> <td>What's reported</td> <td>Inpatient (IP) hospitalizations; Emergency department (ED) visits; adult smoking rates</td> </tr> <tr> <td>How it's reported</td> <td>Crude and age-adjusted rates</td> </tr> <tr> <td>Level of geographic detail</td> <td>State and county</td> </tr> <tr> <td>Level of demographic detail</td> <td>Race/ethnicity and sex</td> </tr> <tr> <td>Data disclaimers</td> <td> <p>HSCRC revised the methodology for coding race/ethnicity in 2013; therefore, race/ethnicity data from 2014 and later may not be comparable to previous years.</p> ICD-9 hospital billing codes transitioned to ICD-10 billing codes in 2015; therefore, data from 2016 and later may not be comparable to previous years. </td> </tr> <tr> <td>The summary data provided on this website are downloadable. For more detailed data, refer to the data sources.</td> <td>Yes</td> </tr> <tr> <td>Environmental Health Helpline</td> <td><a href="tel:+1(866)703-3266">1-866-703-3266</a><br /><a href="mailto:mdh.envhealth@maryland.gov">mdh.envhealth@maryland.gov</a></td> </tr> <tr> <td>Last Updated</td> <td>10/8/2024</td> </tr> <tr> <td>Frequency of data updates</td> <td>Annual</td> </tr> <tr> <td>Data suppression rules </td> <td> <b> HSCRC: </b> <p> County level: suppression is for non-zero numerators <11 and this is reflected in data starting with 2021. Prior to 2021, suppression was for non-zero numerators <6. There is no denominator requirement. </p> <b> BRFSS: </b> <p>Denominator of <50 respondents and/or relative standard error >= 30.0% </p> </td> </tr> </tbody> </table>`,
