    topicPath: "co",
    category: "health",
    defaultTabPath: "edTrends",
    overview:
      "<p>Carbon Monoxide (CO) is a poisonous gas made by the burning of fuel or other materials.  CO has no smell or taste, and it can kill in very small amounts. CO is made by all fuel-burning devices and vehicles, including portable generators, unvented kerosene and gas space heaters, leaking chimneys, and furnaces and gas stoves. CO poisoning can be prevented through education, awareness, and simple protective measures including CO detectors and proper installation and maintenance of all combustion devices.</p>",
    aboutData: `<table> <tbody> <tr> <td>Data Facts</td> <td>Carbon Monoxide Poisoning</td> </tr> <tr> <td>Why these data are important</td> <td> Carbon Monoxide (CO) is often called the “Silent Killer” because of its ability to take lives quickly and quietly when its victims never even knew they were at risk. It is undetectable to humans, being both tasteless and odorless, and it can kill within minutes. CO claims hundreds of lives each year, and survivors of CO poisoning can be left with psychological and neurological symptoms. CO poisoning can be prevented through education, awareness, and simple protective measures including CO detectors and proper installation and maintenance of all combustion devices. </td> </tr> <tr> <td>Data Sources</td> <td> <a target="_blank" rel="noopener noreferrer" href="https://hscrc.maryland.gov/Pages/default.aspx" > Maryland Health Services Cost Review Commission </a> </td> </tr> <tr> <td>Years available</td> <td>2010-most recent data available (usually 1-2 years prior to current date)</td> </tr> <tr> <td>Data source description</td> <td> Hospital billing data from inpatient discharges and emergency department encounters </td> </tr> <tr> <td>What's reported</td> <td> Inpatient (IP) hospitalizations; Emergency department (ED) visits </td> </tr> <tr> <td>How it's reported</td> <td>Age-adjusted rates</td> </tr> <tr> <td>Level of geographic detail</td> <td>State and county</td> </tr> <tr> <td>Level of demographic detail</td> <td>N/A</td> </tr> <tr> <td>Data disclaimers</td> <td> <p> HSCRC revised the methodology for coding race/ethnicity in 2013; therefore, race/ethnicity data from 2014 and later may not be comparable to previous years. </p> ICD-9 hospital billing codes transitioned to ICD-10 billing codes in 2015; therefore, data from 2016 and later may not be comparable to previous years. </td> </tr> <tr> <td> The summary data provided on this website are downloadable. For more detailed data, refer to the data sources. </td> <td>Yes</td> </tr> <tr> <td>Environmental Health Helpline</td> <td> <a href="tel:+1(866)703-3266">1-866-703-3266</a> <br /> <a href="mailto:mdh.envhealth@maryland.gov"> mdh.envhealth@maryland.gov </a> </td> </tr> <tr> <td>Last Updated</td> <td>10/8/2024</td> </tr> <tr> <td>Frequency of data updates</td> <td>Annual</td> </tr> <tr> <td> Data suppression rules </td> <td> <b> HSCRC: </b> <p> County level: suppression is for non-zero numerators <11 and this is reflected in data starting with 2021. Prior to 2021, suppression was for non-zero numerators <6. There is no denominator requirement. </p> </td> </tr> </tbody> </table>`,
